import React from 'react';

const SongList = ({ songs, onSongClick, onAddToPlaylist, playlists }) => {
  const handleAddToPlaylist = (song, playlistName) => {
    onAddToPlaylist(song, playlistName);
  };

  return (
    <div className="song-list">
      {songs.map((song) => (
        <div key={song.id} className="song-item" onClick={() => onSongClick(song)}>
          <img src={song.image} alt={song.title} />
          <div>{song.title}</div>
          <div>{song.artist}</div>
          <div>
            {playlists.map((playlist) => (
              <button key={playlist.id} onClick={() => handleAddToPlaylist(song, playlist.name)}>
                Add to {playlist.name}
              </button>
            ))}
          </div>
        </div>
      ))}
    </div>
  );
};

export default SongList;
